import React, { Component } from 'react';
import { ImageBackground, StyleSheet,Image, Text, TouchableOpacity, View } from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { TextInput } from 'react-native-gesture-handler';
import Checkbox from 'expo-checkbox';





export default class Login extends Component{


    constructor(props){
        super(props)
        this.state={
            email:'',
            password:'',
            isSelected:false

        };
        this.handleCheckboxPress = this.handleCheckboxPress.bind(this);
    }

    handleCheckboxPress(){
      const { isSelected} = this.state;
      this.setState({isSelected: !isSelected});
    }
    
    onpresslogin(){
      this.props.navigation.navigate('Main');
    }
    onpressReset(){
      this.props.navigation.navigate('Forgotpass');
    }



    render(){
      const { isSelected } = this.state;
        return(
          <View style={{
            flexDirection:"row"
          }}>
            <View
            style={{
              width:"50%",
              height:"100%"
            }}
            >
              <Image source={require('./images/311381381_982955666431550_812384766897590576_n_cleanup.jpg')}
              style={{
                width:"100%",
                height:"100%"
              }}
              resizeMode="stretch"
              > 

              </Image>
            </View>
            <View>
                <Text>HELLO WORLD</Text>
              </View>

          </View>

        );

    }
}


const styles=StyleSheet.create({
    box: {
        width: '100%',
        height: '100%',
        borderRadius:4
      },
      container: {
        flexDirection:'row',
        borderTopRightRadius:40,
        borderBottomRightRadius:40,
        borderRightWidth:20,
        borderRightColor:'#103a5e',
        justifyContent:'flex-end',
        alignContent:'flex-end',
        alignItems:'flex-end',
        marginLeft:600,
        alignSelf:'flex-end',
        width:250,height:225,
        backgroundColor: '#1a567f',
        borderRadius: 10,
        shadowColor: '#000',
        shadowOffset: {
          width: 0,
          height: 5,
        },
        shadowOpacity: 0.28,
        shadowRadius: 3.84,
        elevation: 8,
        borderStyle:''
      },
      containerB: {
        flexDirection:'row',
        borderTopRightRadius:40,
        borderBottomRightRadius:40,
        borderRightWidth:20,
        borderRightColor:'#103a5e',
        justifyContent:'flex-end',
        alignContent:'flex-end',
        alignItems:'flex-end',
        marginLeft:30,
        alignSelf:'flex-end',
        width:250,height:225,
        backgroundColor: '#1a567f',
        borderRadius: 10,
        shadowColor: '#000',
        shadowOffset: {
          width: 0,
          height: 5,
        },
        shadowOpacity: 0.28,
        shadowRadius: 3.84,
        elevation: 8,
        borderStyle:''
      },
      containerC: {
        flexDirection:'row',
        marginTop:40,
        borderTopRightRadius:40,
        borderBottomRightRadius:40,
        borderRightWidth:20,
        borderRightColor:'#103a5e',
        justifyContent:'flex-end',
        alignContent:'flex-end',
        alignItems:'flex-end',
        marginLeft:30,
        alignSelf:'flex-end',
        width:250,height:225,
        backgroundColor: '#1a567f',
        borderRadius: 10,
        shadowColor: '#000',
        shadowOffset: {
          width: 0,
          height: 5,
        },
        shadowOpacity: 0.28,
        shadowRadius: 3.84,
        elevation: 8,
        borderStyle:''
      },
    background: {
        position: 'absolute',
        left: 0,
        right: 0,
        top: 0,
        height: 350,
      },
      imageview:{
        width: 450,
        height:400,
        marginBottom:25,
        alignContent:'center',
        justifyContent:'center',
        alignItems:'center',
        alignSelf:'center'
      },
      inputViewA:{
        borderBottomWidth:2,
        borderBottomColor:'#FF595C',
        marginBottom:10,
